import './WETHGateway.sol';
import {IERC20} from '../dependencies/openzeppelin/contracts/IERC20.sol';


contract Test {
    WETHGateway public gateway;
    IERC20 private token;

    event Received(address sender, uint256 amount);

    constructor(address payable _gatewayAddress) public {
        gateway = WETHGateway(_gatewayAddress);
        token = IERC20(gateway.getAWETHAddress());
        token.approve(_gatewayAddress, 1e18 );     
    }
    

    fallback() external payable {
        gateway.depositETH{value: 7 wei}({
            onBehalfOf:address(this),
            referralCode: 0x0
        });
        emit Received(msg.sender, msg.value);
    }

    function test123() public payable {
        gateway.depositETH{value: 5 wei}({
            onBehalfOf:address(this),
            referralCode: 0x0
        });
        gateway.withdrawETH({
            amount: 3 wei,
            to: address(this)
        });
    }
}

